['#include<stdio.h>
int main()
{
    long long int n,i,k=0,j=1,l=1,x,y,a,b,s1=0,s2=0,d1,d2,d3;
    scanf("%lld",&n);
    scanf("%lld %lld",&a,&b);
    x=a-b;
    y=a-b;
    for(i=2;i<=n;i++)
    {
        scanf("%lld %lld",&a,&b);
        if((a-b)>x)
        {
            l=i;
            x=a-b;
        }
        if((a-b)<y)
        {
            j=i;
            y=a-b;
        }
        s1=s1+a;
        s2=s2+b;
    }
    d1=s1-s2;
    if(d1<0)
    {
        d1=-d1;
    }
    d2=(s1-x)-(s2+x);
    if(d2<0)
    {
        d2=-d2;
    }
    d3=(s1-y)-(s2+y);
    if(d3<0)
    {
        d3=-d3;
    }
    if(d1>=d2&&d1>=d3)
    {
        printf("0\n");
    }
    else if(d2>=d1&&d2>=d3)
    {
        printf("%lld\n",l);
    }
    else
    {
        printf("%lld\n",j);
    }
    return 0;
}
