['#include<stdio.h>
#include<stdlib.h>
#include<math.h>
int main()
{
    int n,index=0,lsum=0,rsum=0;
    int max;
    scanf("%d",&n);
    int l[n];
    int r[n];
    for(int i=0;i<n;i++)
    {
        scanf("%d%d",&l[i],&r[i]);
        lsum+=l[i];
        rsum+=r[i];
    }
    int actual=abs(lsum-rsum);
    max=abs(lsum-rsum);
    for(int i=n-1;i>=0;i--)
    {
        int x=lsum-l[i]+r[i];
        int z=rsum-r[i]+l[i];
        if(abs(x-z)>max&&abs(x-z)>actual)
        {
            index=i+1;
            max=abs(x-z);
        }
    }
    if(index!=0)
    printf("%d",index);
    else
    printf("0");
}
']

